import React from 'react';
import BooksList from './BooksList'; // Importuojame naują komponentą

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <h1>Sveiki atvykę į biblioteką!</h1>
                <BooksList /> {/* Priedame knygų sąrašą */}
            </header>
        </div>
    );
}

export default App;
